import React from 'react';
import Grid from '@material-ui/core/Grid';
import { Divider } from '../../atoms';
import { Card } from '../../molecules';
import {BasicLayout} from '../../layout';

import './index.scss';

const example = [{name: 'x'}, {name: 'y'}, {name: 'z'}];

export const PublicProfessionalUser = () => {
  return (
    <BasicLayout>
    <Grid container justifyContent='center' className='public-professional-profile'>
      <Grid item xs={12} sm={12}>
        <div className='profile-image__container' >
          <div className='profile-image__background_1'>
            <img src='https://wallpaperaccess.com/full/802645.jpg' alt='background_1'/> 
          </div>
          <div className='profile-image__image'>
            <img alt="profile" src='https://wallpaperaccess.com/full/2213424.jpg'/>
          </div>
          <div className='profile-image__background_2'>
            <h1>Mario Calcuta</h1>
            <p>Lorem ipsum dolor sit amet,
              consectetur adipiscing elit. Pellentesque et odio sed est pellentesque gravida sit amet at orci.
              Phasellus eget iaculis tortor, quis lobortis augue. Proin semper congue libero a efficitur.
              Nunc molestie efficitur urna, ac imperdiet sapien volutpat non. Sed sed elementum elit. </p>
          </div>
        </div>
      </Grid>
      <Grid item xs={12} sm={12}>
        <Divider label='Informacion personal'/>
      </Grid>
      <Grid item xs={12} sm={12}>
        <Divider label='Servicios'/>
      </Grid>
      <Grid item container xs={12} sm={12} className='profile-services__container'>
        {example.map( (x) => {
          return (<Grid item xs={12} sm={4} align='center' key={x.name}><Card serviceName={x.name}/></Grid>);
        })}
      </Grid>
    </Grid>
    </BasicLayout>
  ); 
};
